58aa4191-99d0-47a0-8502-ec856a1a6535.debug:
{
  "query": "
query FocusOrganizationDetails($orgName: String!, $first: Int!, $after:String) {
    rateLimit{
      cost
      limit
      nodeCount
      remaining
      resetAt
      used
    }
    organization(login:$orgName) {
      login
      name,
      createdAt,
      membersWithRole{
        totalCount
      }
      repositories(privacy: PUBLIC, first:$first, after:$after){
        pageInfo{
          endCursor,
          hasNextPage
        }
        nodes{
          ...RepositorySummary
        }
      }
    }
}
fragment RepositorySummary on Repository{
  nameWithOwner,
  isInOrganization
  owner{
      login
  }
  forkCount,
  stargazerCount,
  pullRequests{
    totalCount
  },
  issues{
      totalCount
  }
  mentionableUsers{
      totalCount
  }
  watchers{
      totalCount
  }
  discussions{
    totalCount
  },    
  createdAt,
  isPrivate,
  pushedAt,
  visibility,
  primaryLanguage{
    name
  },
  languages(first:100){
    edges{
      size
      node{
        name
      }
    }
  }
}
",
  "variables": {
    "orgName": "AmanoTeam",
    "first": 25,
    "after": null
  }
}

